import * as React from 'react';
import { FC } from 'react';

import * as classes from './Logo.module.scss';

interface Props {
    height?: number
};

const Logo: FC<Props> = (props) => (
    <div className={classes.Logo} style={{ height: props.height }}>
        
    </div>
);

export default Logo;
